import React from 'react'
import { VidioCard} from '../index'


const Vidios = (props) => {
    const vidios = props.Vidios
    console.log(vidios)
    return (
        <>
            {vidios.map((item , inx) => {
            return <div key={inx}>
                {item.id.vidioId && <VidioCard vidio={item}/>   }
                {/* {item.id.channelId &&   <ChannelCard vidio={item}  />} */}
            </div>
            })}        
        </>

        
    )
}

export default Vidios
